import React from 'react';
import '../App.css'; 

function MyDataGrid(props) {

    return(
        <div className='App'>
            <table>
                <tr>
                    <th></th>
                    <th>Task</th>
                    <th>Priority</th>
                    <th>Due Date</th>
                    <th>Edit</th>
                    <th>Delete</th>
                </tr>
                    {props.rows.map((val, key) => {
                        return (
                            <tr key={key}>
                                <td></td>
                                <td>props.val.text</td>
                                <td>props.val.priority</td>
                                <td>props.val.due_date</td>
                                <td></td>
                                <td></td>
                            </tr>
                        )
                    })}
            </table>
        </div>
    );
}

export default MyDataGrid;
